function Modal(props:any)
{
    function cancelHandle()
    {
        props.onCancel();
    }

    function confirmHandle()
    {
        props.onConfirm();
    }
    return(
        <div className="Modal">
            <p>Are you Sure?</p>
            <button className="btn" onClick={props.cancelHandle}>Cancel</button>
            <button className="btn" onClick={props.confirmHandle}>Delete</button>
        </div>
    );
}

export default Modal;
